import React, { Component } from 'react';

class Aside extends Component {
  render() {
    return (
      <aside className="attachment announcement rule-left">
        <a href="#0">
          2017 Institutional Investor All-America Fixed Income Research Team
          Aside
        </a>
        <span>
          Voting has begun for the 2017 Institutional Investor All-America Fixed
          Income Research Team Survey. Barclays would welcome your support. To
          request a ballot, please go to
          <a href="#0">Institutional Investor</a>.
        </span>
      </aside>
    );
  }
}

export default Aside;
